import { StyleSheet } from 'react-native';
import Constants from 'expo-constants';


export default StyleSheet.create({

    container: {
        flex: 1,
        paddingHorizontal: 24,
        paddingTop: Constants.statusBarHeight + 20,
    },
    title: {
        fontSize: 35,
        fontWeight: 'bold',
    },
    productsList: {
        marginTop: 32,

    },
    product: {
        alignItems: "center",
        flexDirection: "row",
        padding: 10,
        borderRadius: 8,
        marginBottom: 8,
        backgroundColor: '#fff',
    },
    productInfo: {
        marginLeft: 15,
    },
    productValue: {
        marginTop: 8,
        fontSize: 15,
        marginBottom: 8,
        color: "#737380"
    },
    productProperty: {
        fontSize: 14,
        color: "#41414b",
        fontWeight: "bold"
    },
});
